If the second friend asserts a cause of action against the third friend, he should not prevail, because the third friend had no legal duty to warn or protect the second friend from the attack by the first friend. Under the common law, there is generally no affirmative duty to act to protect another from harm, even if one can do so easily, unless a special relationship exists that imposes such a duty, or the person created the peril, or voluntarily assumed a duty. Mere friendship, as described in the scenario, typically does not constitute such a special relationship giving rise to a legal duty to act. Therefore, the third friend's failure to warn, while perhaps morally questionable, would likely not result in legal liability.

The most appropriate answer reflecting this legal principle would be:
\boxed{\text{not prevail, because the third friend had no legal duty to warn the second friend}}

